import React from 'react';

const ColorsList = (props) => {
  console.log(props.colors);

  const list = props.colors.map(color =>
    <div
      style={{"backgroundColor": color.raw_hex }}
      className="color box"
      key={color.raw_hex}>
      {color.raw_hex}
    </div>
  );

  return(
  <div>
    {list}
  </div>
  );
}

export default ColorsList;
